window.bookSummaryJSON = "<p>The initiation is relentless. A new quest is imminent.</p> <p>Triumphant over Anthony Ricci, Alistair now holds the title of Earth's second strongest human, his name etched on the leaderboard. His territory, the Northeast Freehold, stands as a bastion and sanctuary for humankind in the eastern United States. Backed by formidable allies, he is ready for the battles ahead.</p> <p>But the most daunting trials lurk around the corner. Threats abound in every guise – fellow humans, Demon Kings, and enlightened beasts. The fate of Earth hangs in the balance, to be swayed by those with strength.</p> <p>Amidst the chaos of conflict, Alistair has one unwavering intention – to become the strongest.</p>"; 
